import React from 'react';
import styled from 'styled-components';
import * as boxiconsRegular from '@styled-icons/boxicons-regular'

interface FunctionItemProp {
  name: string
}

const FunctionItem = (props: FunctionItemProp) => {
  return (
    <FunctionItemOuter>
      <FunctionItemName>{props.name}</FunctionItemName>
      <FunctionItemArrow><boxiconsRegular.RigthArrowAlt /></FunctionItemArrow>
    </FunctionItemOuter>
  );
};

const FunctionItemOuter = styled.div`
  display: flex;
  align-items: center;
  width: 20em;
  padding: 1em;
  border: 1px solid #e6e2d3;
`;

const FunctionItemName = styled.div`
  flex-grow: 1;
`;

const FunctionItemArrow = styled.div`
`;


export default FunctionItem;
